import React from 'react';
import "./Home.css";
import { Link } from "react-router-dom";
import bitcoin from "../images/bitcoin.png";
import ethereum from "../images/ethereum.png";
import realEstate from "../images/realEstate.jpg"

const Home = () => {
  return (
    <div >
      <section className='home-page-introductory-section'>
        <h1>Investment Securities</h1>
        <p className='home-first-paragraph'>
          If you want to make money and get richer , invest your money in <span>cryptocurrencies</span>,<span>stocks</span> , <span>real estate</span>, <span>bonds</span>, and <span>other securities</span>. Maybe you may need <span>technical advice</span> on <span className='span'>where</span>, <span className='span'>how</span> and <span className='span'>when</span> to invest. LisaConsult is here for you to make your dream come true. Just click the link below to sign up for the course and you will have an amazing life.
        </p>

        <figure className='homepage-title-images'>
          <Link to="/"> <img src={bitcoin} alt="Bitcoin" /> </Link>
          <Link to="/"> <img src={ethereum} alt="Old-Coin" /> </Link>
          <Link to="/"> <img src={realEstate} alt="Real Estate" /> </Link>
        </figure>
      </section>
    </div>


  )
}

export default Home
